import React from "react";
import { Navbar, Container } from 'react-bootstrap'

function Header() {
    return (
        <Navbar className='nav nav-pills text-center flex-column'>
            <Container>
                <Navbar.Brand href="#home">Keeper App</Navbar.Brand>
            </Container>
        </Navbar>
    );
}

export default Header;
